import React from "react";
import Icons from "../../utils/Icon";
import {
  truck,
  chemicals,
  bricks,
  flyash,
  sands,
} from "../../utils/Icon";

import { frame } from "../../utils/Constant";

const Frame = () => {
  return (
    <div className="Frame  ">
      <div className="grid gap-4 grid-cols-4 grid-rows-2 ">
        {frame.map((k, i) => {
          return (
            <div className="ring-1 inline-flex items-center rounded-full bg-[#FFFFFF] ml-[2rem] mt-[] justify-start relative min-h-[180px] w-auto">
              <span className="text-black text-xl align-center " key={i}>
                {k.title}


                <span  className="absolute bottom-0 right-0" key={i+1}>{k.image}</span>


              </span>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Frame;
